const TourData=[
    {
        Image1:MF1,
        Image2:MF2
    },
    {
        Image1:JS,
        Image2:JS1
    },
    {
        Image1:KL,
        Image2:KL1
    },
    {
        Image1:UB,
        Image2:UB1
    },
    {
        Image1:MD,
        Image2:MD1
    },
    {
        Image1:GG,
        Image2:GG1
    },

]

export default TourData;
